  const handleMatch = () => {
    setPositions(targetCombination);
  };

  return (
    <div className="logo">
      <div>{"<"}</div>
      <div className="logo-wheel-even">I A F A R</div>
      <div className="logo-wheel-odd">A F A R I</div>
      <div className="logo-wheel-even">F A R I A</div>
      <div className="logo-wheel-odd">A R I A F</div>
      <div className="logo-wheel-even">R I A F A</div>
      <div>{"/>"}</div>
    </div>
  );
};

